import React, {useEffect, useState} from 'react'

const GetUser = () => {
    return axios
      .get("http://localhost:9090/user")
      .then(({user}) => {
        console.log(user)
        return user
      })
      .catch((err) => {
        console.log(err)
      })
  }

export default function userlist() {

    const [data, setData] = useState([])

    useEffect(() => {
        GetUser().then((userdata) => {
          setData(userdata)
          console.log(userdata)
        })
        console.log(data)
      }, [])

    return (
        <div>
             {
                data.map((info, idx) => {
                    return (
                    <div key={idx} >
                    <p>{info.first}</p>
                    <p>{info.last}</p>
                    <p>{info.gender}</p>
                    </div>
                    )
                })
            }
        </div>
    )
}
